IT’S OFFICIAL! Meet our star-studded panel of judges for the #SHEINX100KCHALLENGE!🌟
@KhloeKardashian - Personality and Entrepreneur
@LuxuryLaw - Image Architect
@Csiriano - American Fashion Designer
@JennaLyonsNYC - Founder of LOVESEEN
@LaurelPantin - InStyle Style Director

Lights, camera, FASHION!  Get ready as 30 amazing designers battle it out for the Top 5 in our FIRST ever SHEIN X 100K Challenge design contest.  The Grand Prize? $100,000 and a chance to showcase their collection in the SHEIN Fall Winter 2021 Runway Show! Watch to find out who takes it all...

Episode 1 PREMIERES on 8/22 2PM PDT on the SHEIN APP, Youtube, Twitter, Facebook, and Instagram! STAY TUNED!✨

#SHEINX100KCHALLENGE
